import React from 'react';
import {Card} from 'react-bootstrap'

const CardPic = props => {

    return(

        <Card className="bg-dark text-white text-center" style={props.style}>

            <Card.Img src={props.image} alt=""/>
            <Card.ImgOverlay className="text-center bg-dark d-column align-center">
                <Card.Title className="my-auto">{props.title}</Card.Title>
                <Card.Text>
                {props.description}
                </Card.Text>
            </Card.ImgOverlay>

            </Card>
    )
}

export default CardPic;
